import React from "react";
import ReactDom from "react-dom";
import "./header.css";

const Header = () => {
	return (
		<header>
			<div class="overlay"></div>
			<div class="intro-heading">
				<header-text>Yo what's up</header-text>
			</div>
		</header>
	);
};

export default Header;
